&lt;h3&gt;4x4 Button Pad w/ RGB LEDs - Staggered LED Footprint&lt;/h3&gt;
&lt;p&gt;Layout and schematic for 4x4 button pad with tri-color LEDs under each button. For use with the 4x &lt;a href=&quot;https://www.sparkfun.com/products/7836&quot;&gt;Button Pad 2x2 - LED Compatible&lt;/a&gt; and 4x &lt;a href=&quot;https://www.sparkfun.com/products/8746&quot;&gt;Button Pad 2x2 Top Bezel&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;Any &lt;a href=&quot;https://www.sparkfun.com/categories/172&quot;&gt;RGB 5mm LED&lt;/a&gt; should be compatible.&lt;/p&gt;
